data.sail_code:
cast(
  typeof(ri!cdt),
  if(
    and(
      rule!AS_CO_UT_isBlank(ri!cdt),
      rule!AS_CO_UT_checkIfArrayType(
        typeOf: ri!cdt
      )
    ),
    ri!cdt,
    reduce(
      rule!AS_CO_UT_zINTERNAL_updateCdtFieldsByPath_handler(
        cdt: _,
        indices: ri!indices,
        field: _,
        newValue: _
      ),
      ri!cdt,
      merge(
        a!flatten(ri!fields),
        a!flatten(ri!newValues)
      )
    )
  )
)

